import React from 'react'
import { Navigate } from 'react-router-dom';
import { Col, Container } from 'reactstrap';

export default function Dashboard() {

  const isAuthenticated = () => {
    return !!localStorage.getItem('token');
  };


  return (
    isAuthenticated()
    ? <Container>
        <Col>
        </Col>
      </Container>
      : <Navigate to='/login' />
  )
}
